import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import HomeCover                from './../../components/CoverPage/HomeCover';
import ContainerBlocksVantages  from './../../components/Contents/ContainerBlocksVantages';

class Home extends Component {
  render() {
    return (
      <div>

        <Header />

          <HomeCover />
          <ContainerBlocksVantages />

        <Footer />

      </div>
    );
  }
}
export default Home;
